//use tailwind styles

function Form(props) {
    console.log(props.object)
    if (props.object === undefined) {
        return (
            <div>
                <h1>Конфигуратор headless_autoplay</h1>
                <p>Загрузите файл конфигурации</p>
            </div>
        );
    }
    return (
        <form>
            {Object.keys(props.object).map((key) => {
                return (
                    <div className="flex flex-col">
                        <label className="text-xl">{key}</label>
                        {typeof props.object[key] === 'object' ? (
                            <Form object={props.object[key]}/>
                        ) : (
                            <input
                                className="border-2 border-black rounded-md"
                                type="text"
                                value={props.object[key]}
                                onChange={(e) => {
                                    props.object[key] = e.target.value;
                                }
                                }
                            />
                        )}
                    </div>
                );
            })}
        </form>
    );
}

export default Form;
